$(function(){chrome.storage.sync.get({convertURLtoLinks:!1,removeBanners:!1},function(e){if(1==e.convertURLtoLinks)if($(".project-brief").length>0){var t=$(".project-brief").html(),o=Autolinker.link(t,{newWindow:!0,stripPrefix:!1});$(".project-brief").html(o)}else console.log("Project description is not visible. If you think it is visible and converting the URLs to links did not work, please report this as a bug to the developer at earvin.piamonte@gmail.com.");if(1==e.removeBanners)var n=setInterval(function(){$("#give-get-banner, #upsell-banners-anchor").length>0?($("#give-get-banner, #upsell-banners-anchor").remove(),console.log("Removed banner.")):(clearInterval(n),console.log("Interval cleared."))},1e3)}),$(".search-result-wrapper, #bid-list-container").length>0?$(".search-result-wrapper, #bid-list-container").append('<p style="text-align:center;padding:1rem 0rem;"><button type="button" class="btn btn-default freelancer-com-helper-btn-scroll-to-top">Scroll to top</button></p>'):console.log("Project feed page or project page is not visible. If you think it is visible and you did not see any Scroll to top button, please report this as a bug to the developer at earvin.piamonte@gmail.com. Scroll to top button appears in project feed and project page only."),$(".freelancer-com-helper-btn-scroll-to-top").on("click",function(){$("html, body").animate({scrollTop:0},100)})});